import logo from './logo.svg';
import './App.css';
import Header from './components/Header';

import Footer from './components/Footer';
function App() {
  return (
    <div className="App">
       <Header/>
       <Slider/>
       <EventAdvertisement/>
       <AboutHome/>
       <EventGalleryHome/>
       <EventExpertiseHome/>
       <SpeakerHome/>
       <TestoHome/>
       <OffersHome/>
       <EventsHome/>
       <NewsHome/>
       <SponserHome/>
       <MapHome/>
       <Footer/>
    </div>
  );
}

export default App;
